<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Client Support Calculator - Strategic Dashboard</title>
    <script crossorigin src="https://unpkg.com/react@18/umd/react.production.min.js"></script>
    <script crossorigin src="https://unpkg.com/react-dom@18/umd/react-dom.production.min.js"></script>
    <script src="https://unpkg.com/@babel/standalone/babel.min.js"></script>
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }
        
        body {
            font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', 'Roboto', 'Helvetica', 'Arial', sans-serif;
            background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
            min-height: 100vh;
            padding: 20px;
        }
        
        .container {
            max-width: 1600px;
            margin: 0 auto;
            background: white;
            border-radius: 12px;
            box-shadow: 0 20px 60px rgba(0,0,0,0.3);
            overflow: hidden;
        }
        
        .header {
            background: linear-gradient(135deg, #1e3c72 0%, #2a5298 100%);
            color: white;
            padding: 30px;
            text-align: center;
        }
        
        .header h1 {
            font-size: 32px;
            font-weight: 700;
            margin-bottom: 8px;
        }
        
        .header p {
            font-size: 16px;
            opacity: 0.9;
        }
        
        .controls {
            background: #f8f9fa;
            padding: 40px;
            border-bottom: 2px solid #e9ecef;
        }
        
        .metric-selector {
            max-width: 1000px;
            margin: 0 auto 30px;
        }
        
        .metric-label {
            display: block;
            font-size: 16px;
            font-weight: 600;
            color: #495057;
            margin-bottom: 20px;
            text-align: center;
            text-transform: uppercase;
            letter-spacing: 1px;
        }
        
        .radio-group {
            display: grid;
            grid-template-columns: repeat(auto-fit, minmax(200px, 1fr));
            gap: 15px;
            margin-bottom: 30px;
        }
        
        .radio-option {
            position: relative;
        }
        
        .radio-option input[type="radio"] {
            position: absolute;
            opacity: 0;
        }
        
        .radio-option label {
            display: block;
            padding: 20px;
            background: white;
            border: 3px solid #dee2e6;
            border-radius: 8px;
            text-align: center;
            cursor: pointer;
            transition: all 0.3s;
            font-weight: 600;
            font-size: 14px;
            color: #495057;
        }
        
        .radio-option input[type="radio"]:checked + label {
            background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
            border-color: #667eea;
            color: white;
            transform: translateY(-4px);
            box-shadow: 0 8px 20px rgba(102, 126, 234, 0.4);
        }
        
        .radio-option label:hover {
            border-color: #667eea;
            transform: translateY(-2px);
        }
        
        .radio-option .subtitle {
            display: block;
            font-size: 11px;
            margin-top: 5px;
            opacity: 0.8;
            font-weight: 400;
        }
        
        .percentage-input {
            max-width: 400px;
            margin: 0 auto 30px;
            background: white;
            padding: 30px;
            border-radius: 8px;
            border: 2px solid #e9ecef;
            text-align: center;
        }
        
        .percentage-input label {
            display: block;
            font-size: 14px;
            font-weight: 600;
            color: #495057;
            margin-bottom: 15px;
            text-transform: uppercase;
            letter-spacing: 0.5px;
        }
        
        .percentage-input input {
            width: 100%;
            padding: 15px;
            font-size: 48px;
            font-weight: 700;
            border: 2px solid #dee2e6;
            border-radius: 6px;
            text-align: center;
            transition: all 0.3s;
            color: #667eea;
        }
        
        .percentage-input input:focus {
            outline: none;
            border-color: #667eea;
            box-shadow: 0 0 0 3px rgba(102, 126, 234, 0.1);
        }
        
        .percentage-input .hint {
            margin-top: 10px;
            font-size: 12px;
            color: #6c757d;
        }
        
        .blended-controls {
            max-width: 900px;
            margin: 0 auto 30px;
            background: white;
            padding: 30px;
            border-radius: 8px;
            border: 2px solid #667eea;
        }
        
        .blended-header {
            text-align: center;
            font-size: 16px;
            font-weight: 700;
            color: #667eea;
            margin-bottom: 20px;
            text-transform: uppercase;
            letter-spacing: 1px;
        }
        
        .blended-grid {
            display: grid;
            grid-template-columns: repeat(3, 1fr);
            gap: 20px;
            margin-bottom: 20px;
        }
        
        .blended-item {
            text-align: center;
        }
        
        .blended-item label {
            display: block;
            font-size: 12px;
            font-weight: 600;
            color: #495057;
            margin-bottom: 8px;
            text-transform: uppercase;
        }
        
        .blended-item input {
            width: 100%;
            padding: 10px;
            font-size: 24px;
            font-weight: 700;
            border: 2px solid #dee2e6;
            border-radius: 6px;
            text-align: center;
            color: #667eea;
        }
        
        .blended-item input:focus {
            outline: none;
            border-color: #667eea;
            box-shadow: 0 0 0 3px rgba(102, 126, 234, 0.1);
        }
        
        .blended-item .sublabel {
            display: block;
            font-size: 10px;
            color: #6c757d;
            margin-top: 5px;
        }
        
        .weights-total {
            text-align: center;
            padding: 15px;
            background: #e7f3ff;
            border-radius: 6px;
            font-weight: 600;
            font-size: 14px;
            color: #0056b3;
        }
        
        .weights-total.error {
            background: #ffe7e7;
            color: #c92a2a;
        }
        
        .calculate-btn {
            display: block;
            width: 100%;
            max-width: 400px;
            margin: 0 auto;
            padding: 20px 40px;
            font-size: 18px;
            font-weight: 700;
            color: white;
            background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
            border: none;
            border-radius: 8px;
            cursor: pointer;
            transition: all 0.3s;
            text-transform: uppercase;
            letter-spacing: 1px;
        }
        
        .calculate-btn:hover {
            transform: translateY(-2px);
            box-shadow: 0 8px 20px rgba(102, 126, 234, 0.4);
        }
        
        .calculate-btn:active {
            transform: translateY(0);
        }
        
        .calculate-btn:disabled {
            opacity: 0.5;
            cursor: not-allowed;
            transform: none;
        }
        
        .results {
            padding: 30px;
        }
        
        .results-header {
            text-align: center;
            margin-bottom: 30px;
        }
        
        .results-header h2 {
            font-size: 24px;
            color: #1e3c72;
            margin-bottom: 10px;
        }
        
        .results-header .metric-badge {
            display: inline-block;
            padding: 8px 20px;
            background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
            color: white;
            border-radius: 20px;
            font-size: 14px;
            font-weight: 600;
        }
        
        .annual-note {
            text-align: center;
            margin-bottom: 20px;
            padding: 12px;
            background: #fff3cd;
            border-radius: 6px;
            color: #856404;
            font-weight: 600;
            font-size: 14px;
        }
        
        .summary-cards {
            display: grid;
            grid-template-columns: repeat(auto-fit, minmax(200px, 1fr));
            gap: 20px;
            margin-bottom: 30px;
        }
        
        .summary-card {
            background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
            color: white;
            padding: 25px;
            border-radius: 8px;
            text-align: center;
        }
        
        .summary-card h3 {
            font-size: 13px;
            font-weight: 600;
            opacity: 0.9;
            margin-bottom: 10px;
            text-transform: uppercase;
            letter-spacing: 0.5px;
        }
        
        .summary-card p {
            font-size: 36px;
            font-weight: 700;
        }
        
        .summary-card .subtext {
            font-size: 12px;
            opacity: 0.8;
            margin-top: 5px;
        }
        
        .table-container {
            overflow-x: auto;
            border-radius: 8px;
            border: 1px solid #e9ecef;
            margin-bottom: 30px;
        }
        
        table {
            width: 100%;
            border-collapse: collapse;
            background: white;
        }
        
        th {
            background: #f8f9fa;
            padding: 16px;
            text-align: left;
            font-size: 12px;
            font-weight: 700;
            color: #495057;
            text-transform: uppercase;
            letter-spacing: 0.5px;
            border-bottom: 2px solid #dee2e6;
        }
        
        td {
            padding: 16px;
            border-bottom: 1px solid #e9ecef;
            font-size: 14px;
        }
        
        tr:hover {
            background: #f8f9fa;
        }
        
        .country-name {
            font-weight: 600;
            color: #1e3c72;
            font-size: 15px;
        }
        
        .number {
            text-align: right;
            font-family: 'Courier New', monospace;
            font-weight: 600;
        }
        
        .no-results {
            text-align: center;
            padding: 80px 20px;
            color: #6c757d;
        }
        
        .no-results-icon {
            width: 100px;
            height: 100px;
            margin: 0 auto 20px;
            opacity: 0.2;
        }
        
        .no-results h3 {
            font-size: 20px;
            margin-bottom: 10px;
        }
        
        .no-results p {
            font-size: 14px;
            color: #adb5bd;
        }
    </style>
</head>

            // Blended metric weights (must sum to 100)
            const [blendedWeights, setBlendedWeights] = useState({

                poverty: 30

                subsistence: 130,
                pension: 100,
                poverty: 100
            });
            
            const [results, setResults] = useState(null);

            const calculateSupport = () => {
                const povertyLineMonthly = 8.3 * 30; // $249 per month
                const countryResults = [];

                // Get unique countries
                const countries = [...new Set(DATA.clients.map(c => c.Country))].filter(c => c).sort();

                countries.forEach(country => {
                    // Get reference data
                    const subsistenceData = DATA.subsistence.find(s => s.Country === country);
                    const pensionData = DATA.pensions.find(p => p.Country === country);
                    const exrateData = DATA.exrates.find(e => e.Country === country);

                    if (!exrateData) return;

                    const exRate = exrateData.For_model;

                    // Filter clients for this country
                    const countryClients = DATA.clients.filter(c => c.Country === country);
                    
                    let totalSupportLocal = 0;
                    let clientsReceivingSupport = 0;

                    countryClients.forEach(client => {
                        const familyIncome = client.Family_Income || 0;
                        let target = 0;

                        // Get client-specific subsistence (for Russia, city-level)
                        let clientSubsistence;
                        if (country === 'Russia') {
                            clientSubsistence = client.City_Subsistence || 16288;
                        } else {
                            clientSubsistence = subsistenceData ? subsistenceData.Subsistence_Numeric : 0;
                        }

                        const clientPension = pensionData ? pensionData.Pension_Numeric : clientSubsistence;
                        const clientPoverty = povertyLineMonthly * exRate;

                        // Calculate target based on selected metric
                        if (selectedMetric === 'subsistence') {
                            target = clientSubsistence * (percentage / 100);
                        } else if (selectedMetric === 'pension') {
                            target = clientPension * (percentage / 100);
                        } else if (selectedMetric === 'poverty') {
                            target = clientPoverty * (percentage / 100);

                            // Combined metric formula
                            target = (blendedWeights.subsistence / 100) * clientSubsistence * (blendedPercentages.subsistence / 100)

                                   + (blendedWeights.poverty / 100) * clientPoverty * (blendedPercentages.poverty / 100);
                        }

                        const support = Math.max(0, target - familyIncome);
                        
                        if (support > 0) {
                            clientsReceivingSupport++;
                            totalSupportLocal += support;
                        }

                    const totalSupportUSD = (totalSupportLocal / exRate) * 12;

                        country,
                        totalClients: countryClients.length,
                        clientsReceivingSupport,
                        totalBudgetUSD: totalSupportUSD
                    });

                    case 'blended': return `Combined Metric (${blendedWeights.subsistence}/${blendedWeights.pension}/${blendedWeights.poverty})`;
                    default: return '';
                }
            };

                if (totals.totalClients === 0) return 0;
                return ((totals.totalReceiving / totals.totalClients) * 100).toFixed(1);

                                    />

                                    </label>
                                </div>

                                        value="poverty"
                                        checked={selectedMetric === 'poverty'}
                                        onChange={(e) => setSelectedMetric(e.target.value)}
                                    />
                                    <label htmlFor="poverty">
                                        World Bank Poverty Line
                                        <span className="subtitle">$8.3/day = $249/month</span>
                                    </label>
                                </div>

                                <div className="radio-option">
                                    <input 
                                        type="radio" 
                                        id="blended" 
                                        name="metric" 
                                        value="blended"
                                        checked={selectedMetric === 'blended'}
                                        onChange={(e) => setSelectedMetric(e.target.value)}
                                    />
                                    <label htmlFor="blended">
                                        Combined Metric (Blended)
                                        <span className="subtitle">Mix of all three metrics</span>
                                    </label>

                                    onChange={(e) => setPercentage(Math.max(0, Number(e.target.value)))}

                                </div>
                            </div>
                        ) : (

                                        <input

                                            value={blendedWeights.subsistence}
                                            onChange={(e) => setBlendedWeights({...blendedWeights, subsistence: Number(e.target.value)})}

                                            max="100"
                                        />

                                    </div>
                                    
                                    <div className="blended-item">
                                        <label>Pension Weight</label>
                                        <input

                                            value={blendedWeights.pension}
                                            onChange={(e) => setBlendedWeights({...blendedWeights, pension: Number(e.target.value)})}
                                            min="0"
                                            max="100"
                                        />
                                        <span className="sublabel">% of total</span>
                                    </div>
                                    
                                    <div className="blended-item">

                                            onChange={(e) => setBlendedWeights({...blendedWeights, poverty: Number(e.target.value)})}

                                            max="100"
                                        />
                                        <span className="sublabel">% of total</span>
                                    </div>
                                </div>

                                <div className={`weights-total ${!weightsValid ? 'error' : ''}`}>
                                    Total Weight: {weightsTotal}% {weightsValid ? '' : '(Must equal 100%)'}
                                </div>

                                <div style={{marginTop: '20px'}}>
                                    <div className="blended-header" style={{fontSize: '14px'}}>Target Percentages per Component</div>
                                    
                                    <div className="blended-grid">

                                            <input
